import React from 'react'



function TableHeader()  {
  return (
    <thead>
      <tr>
        <th>Start</th>
        <th>End</th>
      </tr>
    </thead>
  );
}

function TableBody() {
  return <tbody />
}


function Table() {
    return (
      <table>
        <TableHeader />
        <TableBody />
      </table>
    );
} 

export default Table;
